import React, { useState } from 'react';
import { motion } from 'framer-motion';
import { 
  BookOpen, 
  Play, 
  CheckCircle, 
  Clock, 
  Star,
  Filter,
  Search
} from 'lucide-react';

const TrainingModules = () => {
  const [selectedCategory, setSelectedCategory] = useState('all');
  const [searchTerm, setSearchTerm] = useState('');

  const categories = [
    { id: 'all', name: 'All Modules' },
    { id: 'safety', name: 'Safety' },
    { id: 'operation', name: 'Operation' },
    { id: 'maintenance', name: 'Maintenance' },
    { id: 'advanced', name: 'Advanced' }
  ];

  const modules = [
    {
      id: 1,
      title: 'Basic Safety Protocols',
      category: 'safety',
      description: 'Learn essential safety procedures and protocols for excavator operation.',
      duration: '2 hours',
      difficulty: 'Beginner',
      progress: 100,
      completed: true,
      rating: 4.8,
      lessons: 8
    },
    {
      id: 2,
      title: 'Excavator Controls Mastery',
      category: 'operation',
      description: 'Master the controls and basic operation of different excavator types.',
      duration: '4 hours',
      difficulty: 'Beginner',
      progress: 75,
      completed: false,
      rating: 4.6,
      lessons: 12
    },
    {
      id: 3,
      title: 'Advanced Digging Techniques',
      category: 'operation',
      description: 'Advanced techniques for efficient and precise digging operations.',
      duration: '6 hours',
      difficulty: 'Intermediate',
      progress: 0,
      completed: false,
      rating: 4.9,
      lessons: 15
    },
    {
      id: 4,
      title: 'Preventive Maintenance',
      category: 'maintenance',
      description: 'Learn how to maintain your excavator for optimal performance.',
      duration: '3 hours',
      difficulty: 'Intermediate',
      progress: 0,
      completed: false,
      rating: 4.7,
      lessons: 10
    },
    {
      id: 5,
      title: 'Emergency Procedures',
      category: 'safety',
      description: 'Critical emergency procedures and response protocols.',
      duration: '2.5 hours',
      difficulty: 'Advanced',
      progress: 0,
      completed: false,
      rating: 4.8,
      lessons: 6
    },
    {
      id: 6,
      title: 'Site Planning and Layout',
      category: 'advanced',
      description: 'Advanced site planning and excavation layout techniques.',
      duration: '5 hours',
      difficulty: 'Advanced',
      progress: 0,
      completed: false,
      rating: 4.5,
      lessons: 18
    }
  ];

  const filteredModules = modules.filter(module => {
    const matchesCategory = selectedCategory === 'all' || module.category === selectedCategory;
    const matchesSearch = module.title.toLowerCase().includes(searchTerm.toLowerCase()) ||
                         module.description.toLowerCase().includes(searchTerm.toLowerCase());
    return matchesCategory && matchesSearch;
  });

  const getDifficultyColor = (difficulty) => {
    switch (difficulty) {
      case 'Beginner': return 'bg-green-100 text-green-800';
      case 'Intermediate': return 'bg-yellow-100 text-yellow-800';
      case 'Advanced': return 'bg-red-100 text-red-800';
      default: return 'bg-gray-100 text-gray-800';
    }
  };

  return (
    <div className="min-h-screen bg-gray-50 py-8">
      <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
        {/* Header */}
        <motion.div
          initial={{ opacity: 0, y: 20 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.6 }}
          className="mb-8"
        >
          <h1 className="text-3xl md:text-4xl font-bold text-gray-900 mb-4">
            Training Modules
          </h1>
          <p className="text-xl text-gray-600">
            Master excavator operation with our comprehensive training modules
          </p>
        </motion.div>

        {/* Filters and Search */}
        <motion.div
          initial={{ opacity: 0, y: 20 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.6, delay: 0.1 }}
          className="mb-8"
        >
          <div className="flex flex-col md:flex-row gap-4 items-center justify-between">
            {/* Category Filter */}
            <div className="flex flex-wrap gap-2">
              {categories.map((category) => (
                <button
                  key={category.id}
                  onClick={() => setSelectedCategory(category.id)}
                  className={`px-4 py-2 rounded-lg font-medium transition-colors duration-200 ${
                    selectedCategory === category.id
                      ? 'bg-flannery-600 text-white'
                      : 'bg-white text-gray-700 hover:bg-gray-50 border border-gray-200'
                  }`}
                >
                  {category.name}
                </button>
              ))}
            </div>

            {/* Search */}
            <div className="relative">
              <Search className="absolute left-3 top-1/2 transform -translate-y-1/2 text-gray-400 w-5 h-5" />
              <input
                type="text"
                placeholder="Search modules..."
                value={searchTerm}
                onChange={(e) => setSearchTerm(e.target.value)}
                className="pl-10 pr-4 py-2 border border-gray-300 rounded-lg focus:outline-none focus:ring-2 focus:ring-flannery-500 focus:border-transparent"
              />
            </div>
          </div>
        </motion.div>

        {/* Modules Grid */}
        <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6">
          {filteredModules.map((module, index) => (
            <motion.div
              key={module.id}
              initial={{ opacity: 0, y: 20 }}
              animate={{ opacity: 1, y: 0 }}
              transition={{ duration: 0.6, delay: index * 0.1 }}
              className="card hover:shadow-xl transition-shadow duration-300"
            >
              {/* Module Header */}
              <div className="flex items-start justify-between mb-4">
                <div className="w-12 h-12 bg-flannery-100 rounded-lg flex items-center justify-center">
                  <BookOpen className="w-6 h-6 text-flannery-600" />
                </div>
                {module.completed && (
                  <CheckCircle className="w-6 h-6 text-green-500" />
                )}
              </div>

              {/* Module Info */}
              <h3 className="text-xl font-semibold mb-2">{module.title}</h3>
              <p className="text-gray-600 mb-4">{module.description}</p>

              {/* Module Stats */}
              <div className="flex items-center justify-between mb-4">
                <div className="flex items-center space-x-4 text-sm text-gray-500">
                  <div className="flex items-center">
                    <Clock className="w-4 h-4 mr-1" />
                    {module.duration}
                  </div>
                  <div className="flex items-center">
                    <BookOpen className="w-4 h-4 mr-1" />
                    {module.lessons} lessons
                  </div>
                </div>
                <div className="flex items-center">
                  <Star className="w-4 h-4 text-yellow-400 mr-1" />
                  <span className="text-sm font-medium">{module.rating}</span>
                </div>
              </div>

              {/* Difficulty Badge */}
              <div className="mb-4">
                <span className={`px-3 py-1 rounded-full text-xs font-medium ${getDifficultyColor(module.difficulty)}`}>
                  {module.difficulty}
                </span>
              </div>

              {/* Progress Bar */}
              {!module.completed && (
                <div className="mb-4">
                  <div className="flex justify-between text-sm text-gray-600 mb-1">
                    <span>Progress</span>
                    <span>{module.progress}%</span>
                  </div>
                  <div className="w-full bg-gray-200 rounded-full h-2">
                    <div
                      className="bg-flannery-600 h-2 rounded-full transition-all duration-300"
                      style={{ width: `${module.progress}%` }}
                    ></div>
                  </div>
                </div>
              )}

              {/* Action Button */}
              <button className="w-full btn-primary flex items-center justify-center">
                {module.completed ? (
                  <>
                    <CheckCircle className="w-4 h-4 mr-2" />
                    Completed
                  </>
                ) : (
                  <>
                    <Play className="w-4 h-4 mr-2" />
                    {module.progress > 0 ? 'Continue' : 'Start Module'}
                  </>
                )}
              </button>
            </motion.div>
          ))}
        </div>

        {/* Empty State */}
        {filteredModules.length === 0 && (
          <motion.div
            initial={{ opacity: 0 }}
            animate={{ opacity: 1 }}
            className="text-center py-12"
          >
            <BookOpen className="w-16 h-16 text-gray-400 mx-auto mb-4" />
            <h3 className="text-xl font-semibold text-gray-900 mb-2">No modules found</h3>
            <p className="text-gray-600">Try adjusting your search or filter criteria.</p>
          </motion.div>
        )}
      </div>
    </div>
  );
};

export default TrainingModules;
